cmes4nlno003ii0j8kdr6j6f4	{"en": "Government Integrated Website Management System", "ne": "सरकारी एकीकृत वेवसाइट व्यवस्थापन प्रणाली"}	{"en": "Department of Information Technology (DoIT) has developed an Integrated Website Management System with the main objective of maintaining uniformity among the websites of all government agencies based on the directive for Development and Management of Government Agencies Websites, 2078.\\nBy using this system, government agencies do not have to develop separate websites and even if they do not have skilled manpower related to information technology, the available manpower can easily develop a website based on available contents and publish information/services related to the office.\\nBased on a single template government agency can develop its website by using this system.\\nWebsites developed using this system will be disabled friendly and also include features such as Frequently Asked Questions (FAQ), Complaint Management, Automated Assistant (Chatbot).\\nThe Department of Information Technology will provide the system administrator (Admin User) to the government agency to manage the institutional website. Through the same user, the related agency can add or remove menus and sub-menus on its website, put slogans and logos, manage media files such as galleries, videos and banners. They can perform tasks such as employee details, organization structure, etc.\\nGovernment Integrated Website Management System launch by Honorable Minister of Communication and Information Technology Rekha Sharma . (2079/11/16)", "ne": "सरकारी कार्यालयको वेबसाईट निर्माण तथा व्यवस्थापन सम्वन्धी निर्देशिका २०७८ बमोजिम सबै सरकारी निकायहरूको वेबसाइटहरू बीच एकरूपता कायम गर्न, सूचना प्रविधि विभागले एकीकृत वेवसाइट व्यवस्थापन प्रणालीको विकास गरिएको हो।\\nयस प्रणालीको प्रयोगबाट सरकारी निकायले छुट्टाछुट्टै वेवसाइटहरुको विकास गर्न नपर्ने र सूचना प्रविधि सम्बन्धी दक्ष जनशक्ति नभए पनि उपलब्ध जनशक्तिले वेबसाइट सिर्जना गर्न र कार्यालयसँग सम्बन्धित सूचना तथा जानकारी सहज रुपमा प्रकाशन गर्न सक्नेछन्।\\nयस प्रणालीको प्रयोग गरी सरकारी निकायहरूले एउटै टेम्प्लेटमा आधारित वेबसाइट सिर्जना गर्न सक्नेछन्।\\nयस प्रणालीबाट सिर्जना गरिएका वेबसाइटहरू अपाङ्गता मैत्री हुनुका साथै बारम्बार सोधिने प्रश्न (FAQ), गुनासो व्यवस्थापन, स्वचालित सहायक (Chatbot) लगायतका विशेषताहरु समावेश गरिएका छन्।\\nसूचना प्रविधि विभागले निकायगत वेवसाइट व्यवस्थापन गर्नका लागि प्रणाली व्यवस्थापक (Admin User) सरकारी निकायलाई उपलब्ध गराउनेछ।सोही प्रयोगकर्ता मार्फत सम्बन्धित निकायले आफ्नो वेवसाइटमा मेनु र उप मेनुहरू थपघट गर्न, नारा तथा लोगो राख्न, ग्यालरी, भिडियो र ब्यानर जस्ता मिडिया फाइलहरू व्यवस्थापन गर्न, कर्मचारीको विवरणहरू, संगठन संरचना लगायतका कार्यहरु गर्न सक्नेछन्।\\nमाननीय सञ्चार तथा सूचना प्रविधि मन्त्री रेखा शर्माज्यूबाट एकीकृत वेवसाईट व्यवस्थापन प्रणाली शुभारम्भ । (२०७९/११/१६)"}	{"en": "Government Integrated Website Management System", "ne": "सरकारी एकीकृत वेवसाइट व्यवस्थापन प्रणाली"}	government-integrated-website-management	cmes9mib20074i09ljbcx3jcd	PUBLISHED	\N	t	1	cmee4vm2p0000i0ueo60hwxu2	cmee4vm2p0000i0ueo60hwxu2	2025-08-26 05:50:35.365	2025-08-26 09:39:06.904
cmes4lv0d002ii0j8b21rpdso	{"en": "Government Integrated Office System", "ne": "सरकारी एकीकृत कार्यालय प्रणाली"}	{"en": "Government Integrated Office Management System, developed by Department of Information Technology, has been operationalized as an initiative of the Ministry of Communication and Information Technology's Digital Nepal Framework to implement the concept of paperless government by performing the tasks of government agencies in a simple, easy, fast, economical, transparent and effective manner through a single information technology system.\\n\\nBy using this system, government agencies will be able to issue orders (Tok Aadesh) and comment decisions (Tippani decision), entry and exit registries of letters, approve leave and necessary official tasks (Kaaj), attendance records management, etc. through electronic means. Government agencies can use digital signature to process above mentioned tasks via this system.\\n\\nFor smooth operation of this system, \\"Government agencies operation related Integrated Electronic System Directives, 2078\\" has been approved by Nepal Government (Council of Ministers) and in implementation state after being published in the Gazette dated 2079/05/01.\\n\\nGIOMS is in execution in the Ministry of Communication and Information Technology and its all underlying departments since FY 2078/79; the joining process of the ministries inside the Singhadurbar premises and including other government agencies with this system is ongoing since FY 2079/80 after completing the training provided by the department.\\n\\nGovernment agencies should have correspond with the Department of Information Technology to join and operate this system.", "ne": "सरकारी निकायबाट सम्पादन हुने कार्यहरुलाई एउटै सूचना प्रविधि प्रणाली मार्फत सरल, सहज, छिटो, छरितो, मितव्ययी, पारदर्शी र प्रभावकारी रुपमा सम्पादन गरी कागजरहित सरकारको अवधारणालाई कार्यान्वयन गर्न सञ्चार तथा सूचना प्रविधि मन्त्रालयले डिजिटल नेपाल फ्रेमवर्कको एक पहलका रुपमा सूचना प्रविधि विभागद्वारा विकास गरिएको एकिकृत कार्यालय व्यवस्थापन प्रणाली सञ्चालनमा ल्याइएको हो ।\\n\\nयो प्रणाली प्रयोग गरि सरकारी निकायहरुले विद्युतीय माध्यमबाट तोक आदेश तथा टिप्पणी निर्णय, चिठीपत्रको दर्ता तथा चलानी, हाजिरी बिदा र काज स्वीकृत, अभिलेख व्यवस्थापन लगायतका कार्य गर्न सक्नेछन् । सरकारी निकायले यस प्रणाली मार्फत उल्लेखित कार्य सम्पादन गर्दा विद्युतीय हस्ताक्षर प्रयोग गर्न सक्छन् ।\\n\\nयस प्रणालीको व्यवस्थित सञ्चालनका लागि नेपाल सरकार (मन्त्रीपरिषद)बाट \\"सरकारी निकाय सञ्चालन सम्बन्धी एकीकृत विद्युतीय प्रणाली निर्देशिका, २०७८\\" स्वीकृती भई मिति २०७९/०१/०५ गते राजपत्रमा प्रकाशित पश्चात कार्यान्वयनको अवस्थामा छ\\n\\nआ.व. २०७८/७९ देखि सञ्चार तथा सूचना प्रविधि मन्त्रालय र अन्तर्गतका सबै विभागहरुमा उल्लेखित एकीकृत कार्यालय व्यवस्थापन प्रणाली (GIOMS) कार्यान्वयनमा रहेकोमा विभागद्वारा उपलब्ध गराइने तालिम लिई आ.व.२०७९/८० देखि सिंहदरबार भित्रका मन्त्रालयहरु लगायत अन्य सरकारी निकायहरु यस प्रणालीमा आबद्ध हुने क्रम जारी छ ।\\n\\nसरकारी निकायहरुले यो प्रणालीमा आबद्ध भई कार्य संचालन गर्न सूचना प्रविधि विभागमा पत्राचार गर्नु पर्नेछ ।"}	{"en": "Government Integrated Office System", "ne": "सरकारी एकीकृत कार्यालय प्रणाली"}	government-integrated-office-system	cmes4ihuc000ui0j8lkc89jzf	PUBLISHED	\N	t	1	cmee4vm2p0000i0ueo60hwxu2	cmee4vm2p0000i0ueo60hwxu2	2025-08-26 05:49:14.174	2025-08-26 12:10:46.45
