cmetfar4a004ni03qu4m36udd	{"en": "Must-Visit Places in Far-Western Nepal", "ne": "सुदूर पश्चिम नेपालको घुम्ने ठाउँहरू"}	{"en": "Far-Western Nepal has many attractive places for travelers. The banks of the Mahakali River, views of snow-capped peaks, and historic monasteries attract tourists. Visitors can also experience traditional lifestyle and local cuisine in the villages.", "ne": "सुदूर पश्चिम नेपाल घुम्नको लागि धेरै आकर्षक स्थानहरू छन्। यहाँको महाकाली नदी किनार, शिखर हिमालका दृश्य, र ऐतिहासिक मठहरू पर्यटकहरूको आकर्षण हुन्। साथै, स्थानीय गाउँहरूमा परम्परागत जीवनशैली र खानपान अनुभव गर्न सकिन्छ।"}	{"en": "Far-Western Nepal offers incredible natural beauty and cultural landmarks.", "ne": "सुदूर पश्चिम नेपालमा अविश्वसनीय प्राकृतिक सुन्दरता र सांस्कृतिक स्थलहरू छन्।"}	far-western-nepal-travel	cmetf6d1l004li03qw6hf8jg0	PUBLISHED	\N	t	5	cmee4vm2p0000i0ueo60hwxu2	cmee4vm2p0000i0ueo60hwxu2	2025-08-27 03:36:17.866	2025-08-27 03:36:17.866
cmevsk4lf0006mi01a5uzsdav	{"en": "iCMS Works", "ne": "एकीकृत कन्टेन्ट व्यवस्थापन प्रणाली काम गर्छ"}	{"en": "iCMS, the Integrated Content Management System, is now live and fully operational.\\nIt has been designed to bring together all municipal and institutional websites under a unified platform. With iCMS, administrators can:\\n\\nManage multiple websites from one dashboard\\n\\nUpdate content instantly across platforms\\n\\nEnsure consistent branding and standards\\n\\nImprove security and scalability\\n\\nThis system marks a significant step towards smarter digital governance and simplified content workflows.", "ne": "iCMS, एकीकृत कन्टेन्ट व्यवस्थापन प्रणाली, अहिले सञ्चालनमा छ र पूर्णरूपमा कार्यरत छ।\\nयसलाई सबै नगरपालिका र संस्थागत वेबसाइटलाई एउटै प्लेटफर्ममा ल्याउने उद्देश्यले तयार गरिएको हो। iCMS मार्फत प्रशासकहरूले:\\n\\nएउटै ड्यासबोर्डबाट धेरै वेबसाइट व्यवस्थापन गर्न सक्ने\\n\\nसामग्री तुरुन्तै सबै प्लेटफर्ममा अद्यावधिक गर्न सक्ने\\n\\nएउटै ब्राण्डिङ र मापदण्ड सुनिश्चित गर्न सक्ने\\n\\nसुरक्षा र स्केलेबिलिटीमा सुधार ल्याउन सक्ने\\n\\nयो प्रणाली स्मार्ट डिजिटल सुशासन र सरल सामग्री व्यवस्थापन workflow तर्फको महत्वपूर्ण कदम हो।"}	{"en": "The new Integrated Content Management System (iCMS) is up and running, enabling seamless content updates, multi-site management, and smooth user experience.", "ne": "नयाँ एकीकृत कन्टेन्ट व्यवस्थापन प्रणाली (iCMS) सञ्चालनमा आएको छ, जसले सहज सामग्री अद्यावधिक, बहु–साइट व्यवस्थापन र सहज प्रयोगकर्ता अनुभव प्रदान गर्छ।"}	icms-works	cmes4t6f80055i0j82rd3ub6j	PUBLISHED	\N	t	4	cmee4vm2p0000i0ueo60hwxu2	cmee4vm2p0000i0ueo60hwxu2	2025-08-28 19:23:02.594	2025-08-28 19:23:02.594
